import React, {Component} from 'react';
import {useSpring, animated} from 'react-spring';
import { Typography } from '@material-ui/core';



class FadeTypography extends Component{

    // constructor(){
    //     super();
    //     this.state = {
    //         toggled: false,
    //     }
    // }


    render(){
        const animate = useSpring({opacity: 1, from: {opacity: 0}})
        return(
            <Typography className={this.props.className}
            style={animate}>
                {this.props.children}
            </Typography>
        )
    }
}

export default FadeTypography
